import React, { useState } from "react";
function App(number = 0) {
  [number, setNumber] = useState(number);
  const increamentNumber = function () {
    setNumber(number++);
  };
  return (
    <div>
      <button onClick={increamentNumber}>increament</button>
      <label>{number}</label>
    </div>
  );
}

export default App;
